import React, { useState } from 'react';
import axios from 'axios';

const App1 = () => {

    // const [name, setName] = useState("");

    const fetchData = async() => {
        const result = await fetch('https://api.github.com/users/thenanosoft');
        const colectData = await result.json();
        console.log(colectData);
    }


  return (
    <div>
      <div>
          <input type="text" />
          <button onClick={fetchData}>Add</button>
      </div>
    </div>
  )
}

export default App1
